INSERT INTO `btc_content` VALUES ('84', '底栏关于我们', '0', '隐私政策', '<br>新虚拟币证券网尊重并保护所有使用新虚拟币证券网平台服务用户的个人隐私权。为了给您提供更准确、更有个性化的服务，新虚拟币证券网会按照本隐私权政策的规定使用和披露您的个人信息。但新虚拟币证券网将以高度的勤勉、审慎义务对待这些信息。除本隐私权政策另有规定外，在未征得您事先许可的情况下，新虚拟币证券网不会将这些信息对外披露或向第三方提供。新虚拟币证券网会不时更新本隐私权政策。 您在同意新虚拟币证券网服务协议之时，即视为您已经同意本隐私权政策全部内容。本隐私权政策属于新虚拟币证券网服务协议不可分割的一部分。<br><br>&nbsp;&nbsp;&nbsp; 适用范围<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在您注册或激活可以登录新虚拟币证券网平台的账户时，您在新虚拟币证券网平台或者其关联公司提供的其他平台提供的个人注册信息（应法律法规要求需公示的企业名称等相关工商注册信息以及自然人经营者的信息除外）；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在您使用新虚拟币证券网平台服务，或访问新虚拟币证券网平台网页时，新虚拟币证券网自动接收并记录的您的浏览器和计算机上的信息，包括但不限于您的IP地址、浏览器的类型、使用的语言、访问日期和时间、软硬件特征信息及您需求的网页记录等数据；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 新虚拟币证券网通过合法途径从商业伙伴处取得的用户个人数据。<br>&nbsp;&nbsp;&nbsp; 信息使用<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 新虚拟币证券网不会向任何无关第三方提供、出售、出租、分享或交易您的个人信息，除非事先得到您的许可，或该第三方和新虚拟币证券网（含新虚拟币证券网关联公司）单独或共同为您提供服务，且在该服务结束后，其将被禁止访问包括其以前能够访问的所有这些资料。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 新虚拟币证券网亦不允许任何第三方以任何手段收集、编辑、出售或者无偿传播您的个人信息。任何新虚拟币证券网平台用户如从事上述活动，一经发现，新虚拟币证券网有权立即终止与该用户的服务协议。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 为服务用户的目的，新虚拟币证券网可能通过使用您的个人信息，向您提供您感兴趣的信息，包括但不限于向您发出产品和服务信息，或者与新虚拟币证券网合作伙伴共享信息以便他们向您发送有关其产品和服务的信息（后者需要您的事先同意）。<br>&nbsp;&nbsp;&nbsp; 信息披露<br>&nbsp;&nbsp;&nbsp; 在如下情况下，新虚拟币证券网将依据您的个人意愿或法律的规定全部或部分的披露您的个人信息：<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 经您事先同意，向第三方披露；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 如您是适格的知识产权投诉人并已提起投诉，应被投诉人要求，向被投诉人披露，以便双方处理可能的权利纠纷；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 根据法律的有关规定，或者行政或司法机构的要求，向第三方或者行政、司法机构披露；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 如您出现违反中国有关法律、法规或者新虚拟币证券网服务协议或相关规则的情况，需要向第三方披露；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 为提供您所要求的产品和服务，而必须和第三方分享您的个人信息；<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在新虚拟币证券网平台上创建的某一交易中，如交易任何一方履行或部分履行了交易义务并提出信息披露请求的，新虚拟币证券网有权决定向该用户提供其交易对方的联络方式等必要信息，以促成交易的完成或纠纷的解决。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 其它新虚拟币证券网根据法律、法规或者网站政策认为合适的披露。<br>&nbsp;&nbsp;&nbsp; 信息存储和交换<br>&nbsp;&nbsp;&nbsp; 新虚拟币证券网收集的有关您的信息和资料将保存在新虚拟币证券网及（或）其关联公司的服务器上，这些信息和资料可能传送至您所在国家、地区或新虚拟币证券网收集信息和资料所在地的境外并在境外被访问、存储和展示。<br>&nbsp;&nbsp;&nbsp; Cookie的使用<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在您未拒绝接受cookies的情况下，新虚拟币证券网会在您的计算机上设定或取用cookies，以便您能登录或使用依赖于cookies的新虚拟币证券网平台服务或功能。新虚拟币证券网使用cookies可为您提供更加周到的个性化服务，包括推广服务。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 您有权选择接受或拒绝接受cookies。您可以通过修改浏览器设置的方式拒绝接受cookies。但如果您选择拒绝接受cookies，则您可能无法登录或使用依赖于cookies的新虚拟币证券网平台服务或功能。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 通过新虚拟币证券网所设cookies所取得的有关信息，将适用本政策；<br>&nbsp;&nbsp;&nbsp; 信息安全<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 您的账户均有安全保护功能，请妥善保管您的账户及密码信息。新虚拟币证券网将通过向其它服务器备份、对用户密码进行加密等安全措施确保您的信息不丢失，不被滥用和变造。尽管有前述安全措施，但同时也请您注意在信息网络上不存在“完善的安全措施”。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在使用新虚拟币证券网平台服务进行网上交易时，您不可避免的要向交易对方或潜在的交易对方披露自己的个人信息，如联络方式或者邮政地址。请您妥善保护自己的个人信息，仅在必要的情形下向他人提供。如您发现自己的个人信息泄密，尤其是你的账户及密码发生泄露，请您立即联络新虚拟币证券网客服，以便新虚拟币证券网采取相应措施。<br>&nbsp;&nbsp;&nbsp; 未成年人的特别注意事项<br>&nbsp;&nbsp;&nbsp; 如果您不是具备完全民事权利能力和完全民事行为能力的自然人，您无权使用新虚拟币证券网平台服务，因此新虚拟币证券网希望您不要向我们提供任何个人信息。 <br><br><br>', '2014/07/02 13:31:49', 'java币团队');
INSERT INTO `btc_content` VALUES ('85', '底栏关于我们', '0', '法律声明', '新虚拟币证券网提醒您：在使用新虚拟币证券网平台各项服务前，请您务必仔细阅读并透彻理解本声明。您可以选择不使用新虚拟币证券网平台服务，但如果您使用新虚拟币证券网平台服务的，您的使用行为将被视为对本声明全部内容的认可。<br><br>鉴于新虚拟币证券网提供的服务为互联网信息服务，新虚拟币证券网平台上关于新虚拟币证券网平台会员或其发布的相关比特币信息均由会员自行提供，会员依法应对其提供的任何信息承担全部责任。<br><br>任何单位或个人认为新虚拟币证券网平台网页内容（包括但不限于新虚拟币证券网平台会员发布的交易信息）可能涉嫌侵犯其合法权益，应该及时向新虚拟币证券网提出书面权利通知，并提供身份证明、权属证明、具体链接（URL）及详细侵权情况证明。新虚拟币证券网在收到上述法律文件后，将会依法尽快移除相关涉嫌侵权的内容。<br><br>新虚拟币证券网平台转载作品（包括论坛内容）出于传递更多信息之目的，并不意味新虚拟币证券网（包括新虚拟币证券网关联企业）赞同其观点或证实其内容的真实性。新虚拟币证券网网尊重合法版权，反对侵权盗版。若本网有部分文字、摄影作品等侵害了您的权益，在此深表歉意。<br><br>', '2014/07/02 13:34:31', 'java币团队');
INSERT INTO `btc_content` VALUES ('86', '底栏关于我们', '0', '服务协议', '<br>新虚拟币证券网服务协议<br><br>最新修订日期：2014年7月2日<br><br>新虚拟币证券网尊重并保护所有使用新虚拟币证券网平台服务用户的个人隐私权。为了给您提供更准确、更有个性化的服务，新虚拟币证券网会按照本隐私权政策的规定使用和披露您的个人信息。但新虚拟币证券网将以高度的勤勉、审慎义务对待这些信息。除本隐私权政策另有规定外，在未征得您事先许可的情况下，新虚拟币证券网不会将这些信息对外披露或向第三方提供。新虚拟币证券网会不时更新本隐私权政策。 您在同意新虚拟币证券网服务协议之时，即视为您已经同意本隐私权政策全部内容。本隐私权政策属于新虚拟币证券网服务协议不可分割的一部分。<br><br>本协议由您与新虚拟币证券网的经营者共同缔结，本协议具有合同效力。<br><br>新虚拟币证券网的经营者是指法律认可的经营该平台网站的责任主体，有关新虚拟币证券网经营者的信息请查看新虚拟币证券网首页底部公布的公司信息和证照信息。本协议中新虚拟币证券网的经营者可单称或统称为“上海萨图西网络有限公司”。“新虚拟币证券网”指由新虚拟币证券网运营的网络平台，包括但不限于新虚拟币证券网网，域名为 btcchina.com、https://btcchina.com、“www.btcchina.com”，该网站属于加密网站。<br>一、 协议内容及签署<br><br>&nbsp;&nbsp;&nbsp; 本协议内容包括协议正文及所有新虚拟币证券网已经发布的或将来可能发布的各类规则。所有规则为本协议不可分割的组成部分，与协议正文具有同等法律效力。除另行明确声明外，任何新虚拟币证券网及其关联公司提供的服务（以下称为新虚拟币证券网服务）均受本协议约束。<br>&nbsp;&nbsp;&nbsp; 您应当在使用新虚拟币证券网服务之前认真阅读全部协议内容，对于协议中以加粗字体显示的内容，您应重点阅读。如您对协议有任何疑问的，应向新虚拟币证券网咨询。但无论您事实上是否在使用新虚拟币证券网服务之前认真阅读了本协议内容，只要您使用新虚拟币证券网服务，则本协议即对您产生约束，届时您不应以未阅读本协议的内容或者未获得新虚拟币证券网对您问询的解答等理由，主张本协议无效，或要求撤销本协议。<br>&nbsp;&nbsp;&nbsp; 您承诺接受并遵守本协议的约定。如果您不同意本协议的约定，您应立即停止注册/激活程序或停止使用新虚拟币证券网服务。<br>&nbsp;&nbsp;&nbsp; 新虚拟币证券网有权根据需要不时地制订、修改本协议及/或各类规则，并以网站公示的方式进行公告，不再单独通知您。变更后的协议和规则一经在网站公布后，立即自动生效。如您不同意相关变更，应当立即停止使用新虚拟币证券网服务。您继续使用新虚拟币证券网服务的，即表示您接受经修订的协议和规则。<br><br>二、 注册与账户<br><br>&nbsp;&nbsp;&nbsp; 注册者资格<br>&nbsp;&nbsp;&nbsp; 您确认，在您完成注册程序或以其他新虚拟币证券网允许的方式实际使用新虚拟币证券网服务时，您应当是具备完全民事权利能力和完全民事行为能力的自然人、法人或其他组织。若您不具备前述主体资格，则您及您的监护人应承担因此而导致的一切后果，且新虚拟币证券网有权注销或永久冻结您的账户，并向您及您的监护人索偿。<br>&nbsp;&nbsp;&nbsp; 注册和账户<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 在您按照注册页面提示填写信息、阅读并同意本协议且完成全部注册程序后，或在您按照激活页面提示填写信息、阅读并同意本协议且完成全部激活程序后，或您以其他新虚拟币证券网允许的方式实际使用新虚拟币证券网服务时，您即受本协议约束。您可以使用您提供或确认的邮箱、手机号码或者新虚拟币证券网允许的其它方式作为登录手段进入新虚拟币证券网。您必须提供您的真实姓名、身份证件类型和身份证件号码等法律法规规定的信息。如果您在注册时提供的信息不准确，新虚拟币证券网对此不承担任何责任，您将承担因此产生的任何直接或间接损失及不利后果。<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 您可以对账户设置新虚拟币证券网昵称，您也可以通过该新虚拟币证券网昵称和登录名密码登录新虚拟币证券网。您设置的新虚拟币证券网昵称不得侵犯或涉嫌侵犯他人合法权益。如您设置的新虚拟币证券网昵称涉嫌侵犯他人合法权益，新虚拟币证券网有权终止向您提供新虚拟币证券网服务，注销您的新虚拟币证券网昵称。新虚拟币证券网昵称被注销后将开放给